import { CreateFinger } from '../CreateFinger/CreateFinger';
import '../GuitarTab/GuitarTab.css';

export function GuitarTab({ position }) {
  let markup = ``;
  for (let i = 0; i < position.fingers.length; i++) {
    console.log(position.fingers[i]);
    console.log(position.frets[i]);
    markup += `<div className="tabBg">
      <CreateFinger finger={2} fret={3} />
    </div>`;
    return <> {markup}</>;
  }
}
